tangible_template.style:
$highlight_color: #00749C; // This is a SASS variable. Try changing it!
$category_color: #444140;

.tt-loop {
  padding: 1rem;
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  gap: 1rem;

  @media(max-width: 992px) {
    grid-template-columns: repeat(2, 1fr);
  }
  @media(max-width: 500px) {
    grid-template-columns: repeat(1, 1fr);
  }

  .tt-item .tt-item-wrapper, 
  .tt-item .tt-item-wrapper > .tt-item-link {
    position: relative;
    display: -ms-flexbox;
    display: -webkit-flex;
    display: flex;
    -ms-flex-direction: column;
    flex-direction: column;
    -ms-flex-align: center;
    align-items: center;
    height: 100%;
  }
  .tt-card {
    background-color: #fff;
    border-radius: 33px;
    box-shadow: 0 4px 4px rgba(0, 0, 0, .1);
  }
  a.tt-card, 
  .tt-card.tt-item-wrapper.tt-item-link {
    -webkit-transition: box-shadow .2s ease-in-out;
    transition: box-shadow .2s ease-in-out;
  }
  .tt-item-link {
    text-decoration: none;
  }
  .tt-item-image-panel {
    height: 0;
    overflow: hidden;
    padding-top: 63%;
    width: 100%;
    position: relative;
    background-color: $highlight_color;
    margin-bottom: 0 !important;
  }
  .tt-item-image-panel img {
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    height: 100%;
    width: 100%;
    object-fit: cover;
    object-position: center;
    -ms-transform: scale(1.05);
    -webkit-transform: scale(1.05);
    transform: scale(1.05);
    will-change: -ms-transform;
    will-change: -webkit-transform;
    will-change: transform;
    -webkit-transition: .4s ease-in-out !important;
    transition: .4s ease-in-out !important;
    padding: 0;
  }
  .tt-item-link.tt-item-wrapper:hover .tt-item-image-panel img, 
  .tt-item-link.tt-item-wrapper:focus .tt-item-image-panel img {
    -ms-transform: scale(1);
    -webkit-transform: scale(1);
    transform: scale(1);
  }
  .tt-item-wrapper.tt-card .tt-item-image-panel {
    border-top-left-radius: 32px;
    border-top-right-radius: 32px;
  }
  .tt-item .tt-item-content {
    width: 100%;
    padding: 1.5rem;
    box-sizing: border-box;
  }
  .tt-item-meta {
    color: #767676;
    font-size: 0.889em;
    margin-bottom: 0.5rem;
  }
  .badge {
    display: -ms-inline-flexbox;
    display: -webkit-inline-flex;
    display: inline-flex;
    -ms-flex-align: center;
    align-items: center;
    border-radius: 33px 33px 33px 0;
    font-weight: bold;
    font-size: 0.7rem;
    padding: 0.25rem 0.5rem;
    box-shadow: rgba(255, 100, 124, 0.16) 0px 0px 15px 0px;
    background-color: #FF647C;
    color: $category_color;
    position: absolute;
    margin-top: -2.35rem;
  }
  .tt-item-title {
    margin-top: 0.25rem;
    margin-bottom: 0.25rem;
    font-size: 1.2rem;
    color: #04232d;
  }
  .tt-item-description {
    color: #04232d;
    font-size: 0.9rem;
  }

  .tt-item .tt-item-wrapper > .tt-item-header, .tt-item .tt-item-wrapper > .tt-item-footer {
    -ms-flex: 0 1 auto;
    flex: 0 1 auto;
    width: 100%;
    display: -ms-flexbox;
    display: -webkit-flex;
    display: flex;
    -ms-flex-wrap: wrap;
    flex-wrap: wrap;
  }
  .tt-item .tt-item-wrapper > .tt-item-footer {
    margin-top: auto;
  }
  .tt-item-footer button {
    border-radius: 32px 0 32px 0;
    margin-left: auto;
    width: 224px;
    max-width: calc(100% - 1.5rem);
    background-color: $highlight_color;
    color: #fff;
    padding: 1.2em 2em 1.2em 2em;
    border: 0;
  }
  .tt-item-link.tt-item-wrapper:hover .tt-item-footer button, 
  .tt-item-link.tt-item-wrapper:focus .tt-item-footer button {
    background-color: lighten( $highlight_color, 10% );
  }
}
